import React from 'react';
import Link from 'next/link';
import {ForceGraph, ForceGraphNode, ForceGraphLink} from 'react-vis-force';

const PersonLink = props => (
  <li>
    <Link href={`/post/${props.name}`}>
      <a>{props.name}</a>
    </Link>
  </li>
);

const Index = () => (
    <div>

<ForceGraph simulationOptions={{ height: 300, width: 300 }}>
  <ForceGraphNode node={{ id: 'first-node' }} fill="red" />
  <ForceGraphNode node={{ id: 'second-node' }} fill="blue" />
  <ForceGraphLink link={{ source: 'first-node', target: 'second-node' }} />
</ForceGraph>
<ul>
        <PersonLink title="Lev Parnas" />
        <PersonLink title="Donald Trump" />
        <PostLink title="Jared Kushner" />
      </ul>
    </div>
);

export default Index;
